import './PortfolioList.scss'

export default function PortfolioList({title, active, setSelected, id}) {
    const link = 'www.walmart.com'
    return (
        <li className={active ? 'portfolioList active' : 'portfolioList'} onClick={() => setSelected(id)}>
            {title}
        </li>
    )
}
